import Header from "./Header";

const Layout = props => (
  <div>
    <Header className="header" />
    <div className="layout">{props.children}</div>
    <div className="social">What</div>
    <style jsx>
      {`
        *,
        *::before,
        *::after {
          box-sizing: border-box;
          margin: 0;
          padding: 0;
        }

        .layout {
          height: 100%;
          pointer-events: none;
          position: absolute;
          top: 0;
          width: 100%;
        }

        .social {
          border: 3px pink solid;
        }
      `}
    </style>
  </div>
);

export default Layout;
